import React from "react";

export default function Countries(props) {
  return (
    <ul className="Countries">
      {props.countries.map((country, index) => {
        return (
          <li key={index}>
            The capital city of {country.name} is {country.capital}
          </li>
        );
      })}
    </ul>
  );
}
